import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const ProtectedRoute = ({ component: Component, isLoggedIn, ...rest }) => {
  return (
    <Route
      {...rest}
      element={
        isLoggedIn ? (
          <Component />
        ) : (
          <Navigate to="/not-found" />
        )
      }
    />
  );
};

export default ProtectedRoute;
